import React from 'react'
import Navbar from './components/navbar'
import Login from './components/LoginPage'
import { ToastContainer } from 'react-toastify'
import "react-toastify/dist/ReactToastify.css";

function App() {
  return (
    <>
      <Navbar />
      <Login />
      <ToastContainer />
    </>
  )
}

export default App
